// Special-handling to address deficiencies in the PingOne Credentials Connector
module.exports = a = async ({params}) => {

    // If keys are not defined, the connector expects an empty string (not null string).
	// Although input schema is defined as string, an empty object is encountered - handling the condition.
	if ( params.requestedKeys === "{}" ) {
		return {'formattedRequestedKeys': ""}
	}

	return {'formattedRequestedKeys': params.requestedKeys}
}
